import React  from 'react';


const New = () =>{

  const handleSubmit =(e)=>{
    e.preventDefault();
    console.log('You clicked submit.');
  }
  return(
    <div className="center">
      <h1>Meetup Form</h1>
      <form>
      <label> Meetup Name:</label> <input className="one" type="text" /><br />
        <label> Meetup Description:</label> <input  className="two" type="text" /><br />
        <label> Meetup Organization:</label> <input  className="three" type="text" /><br />
        <label> Meetup Contact.No:</label> <input  className="four" type="text" /><br />
        <label> Meetup Date:</label> <input  className="five" type="date" /><br /> 
        <label> Meetup Address: </label><input  className="six" type="text" /><br /> 
     <button className="button"  onSubmit={handleSubmit}> Sumbit</button>
      </form>
    </div>
  )
}

export default New;
